1. laudo de análise 489.1P.0/2023 do produto "canela", marca Rei dos condimentos, lote 9026, com parecer satisfatório para todas as análises realizadas;
2. laudo de análise 490.1P.0/2023 do produto "sal marinho grosso iodado", marca Dunas Grill, lote 001/22. RP, com parecer insatisfatório para rotulagem e satisfatório para as demais análises.
